import styled from "styled-components"
import { Product } from "./Product"
import { popularProducts } from "../data.js"

const Container = styled.div`
display: flex;
justify-content: center;
align-items: center;
flex-wrap: wrap;
`

export const Products = () => {
    return (
        <Container>
            {popularProducts.map(item => (
                <Product item={item} />
            ))}
        </Container>
    )
}
